import SecurityIcon from '@mui/icons-material/Security';
import DateRangeIcon from '@mui/icons-material/DateRange';
import EventAvailableIcon from '@mui/icons-material/EventAvailable';
import RefreshIcon from '@mui/icons-material/Refresh';
import ErrorOutlineIcon from '@mui/icons-material/ErrorOutline';
import SlowMotionVideoIcon from '@mui/icons-material/SlowMotionVideo';

// Statistik-Komponente
const StatCard = ({ title, value, icon, color, subtitle, percent, trend }) => {
  const theme = useTheme();
  
  return (
    <Card 
      elevation={0} 
      sx={{ 
        height: '100%',
        borderRadius: 3,
        border: '1px solid rgba(0,0,0,0.05)',
        '&:hover': {
          boxShadow: '0 4px 12px rgba(0,0,0,0.08)',
          transform: 'translateY(-4px)'
        },
        transition: 'transform 0.2s, box-shadow 0.2s'
      }}
    >
      <CardContent sx={{ p: 3 }}>
        <Box sx={{ display: 'flex', justifyContent: 'space-between', mb: 2 }}>
          <Box>
            <Typography variant="body2" color="text.secondary" gutterBottom>
              {title}
            </Typography>
            <Typography variant="h4" component="div" fontWeight="bold">
              {value}
            </Typography>
            {subtitle && (
              <Typography variant="caption" color="text.secondary">
                {subtitle}
              </Typography>
            )}
          </Box>
          <Avatar 
            sx={{ 
              bgcolor: `${color}.light`, 
              color: theme.palette[color].main,
              width: 48,
              height: 48
            }}
          >
            {icon}
          </Avatar>
        </Box>
        
        {percent !== undefined && (
          <Box sx={{ mt: 2 }}>
            <Box sx={{ display: 'flex', alignItems: 'center', justifyContent: 'space-between', mb: 0.5 }}>
              <Typography variant="caption" color="text.secondary">
                Auslastung
              </Typography>
              <Typography variant="caption" fontWeight="bold" color={
                percent > 80 ? 'error.main' : 
                percent > 60 ? 'warning.main' : 'success.main'
              }>
                {percent}%
              </Typography>
            </Box>
            <LinearProgress 
              variant="determinate" 
              value={percent} 
              sx={{ 
                height: 6, 
                borderRadius: 3,
                bgcolor: 'rgba(0,0,0,0.04)',
                '& .MuiLinearProgress-bar': {
                  bgcolor: percent > 80 ? theme.palette.error.main : 
                          percent > 60 ? theme.palette.warning.main : 
                          theme.palette.success.main
                }
              }} 
            />
          </Box>
        )}
        
        {trend && (
          <Box sx={{ display: 'flex', alignItems: 'center', mt: 1 }}>
            <Chip 
              size="small" 
              label={`${trend > 0 ? '+' : ''}${trend}% seit letzter Woche`} 
              color={trend > 0 ? 'success' : 'error'} 
              sx={{ 
                height: 20, 
                fontSize: '0.7rem',
                borderLeft: '4px solid',
                borderColor: trend > 0 ? 'success.main' : 'error.main'
              }}
            />
          </Box>
        )}
      </CardContent>
    </Card>
  );
};

// Einsatzkarten-Komponente
const EmergencyCard = ({ title, location, time, type, status, priority }) => {
  const theme = useTheme();
  const navigate = useNavigate();
  
  // Icon und Farbe basierend auf dem Typ auswÃ¤hlen
  const getTypeIcon = (type) => {
    switch(type) {
      case 'brand':
        return <LocalFireDepartmentIcon />;
      case 'medizin':
        return <LocalHospitalIcon />;
      case 'unfall':
        return <DirectionsCarIcon />;
      default:
        return <WarningAmberIcon />;
    }
  };
  
  const getTypeColor = (type) => {
    switch(type) {
      case 'brand':
        return theme.palette.fire.main;
      case 'medizin':
        return theme.palette.medical.main;
      case 'unfall':
        return theme.palette.warning.main;
      default:
        return theme.palette.primary.main;
    }
  };
  
  // Status-Badge
  const getStatusChip = (status) => {
    switch(status) {
      case 'aktiv':
        return <Chip size="small" label="Aktiv" color="error" sx={{ 
          height: 20, 
          fontSize: '0.7rem', 
          borderLeft: '4px solid',
          borderColor: 'error.main'
        }} />;
      case 'inbearbeitung':
        return <Chip size="small" label="In Bearbeitung" color="warning" sx={{ 
          height: 20, 
          fontSize: '0.7rem',
          borderLeft: '4px solid',
          borderColor: 'warning.main'
        }} />;
      case 'abgeschlossen':
        return <Chip size="small" label="Abgeschlossen" color="success" sx={{ 
          height: 20, 
          fontSize: '0.7rem',
          borderLeft: '4px solid',
          borderColor: 'success.main'
        }} />;
      default:
        return <Chip size="small" label="Offen" color="primary" sx={{ 
          height: 20, 
          fontSize: '0.7rem',
          borderLeft: '4px solid',
          borderColor: 'primary.main'
        }} />;
    }
  };
  
  // PrioritÃ¤ts-Indikator
  const priorityColor = priority === 'hoch' ? theme.palette.error.main : 
                        priority === 'mittel' ? theme.palette.warning.main : 
                        theme.palette.success.main;
  
  return (
    <Paper 
      elevation={0} 
      sx={{ 
        p: 2, 
        borderRadius: 2, 
        mb: 2,
        position: 'relative',
        overflow: 'hidden',
        borderLeft: `4px solid ${getTypeColor(type)}`,
        '&:hover': {
          boxShadow: '0 4px 8px rgba(0,0,0,0.08)',
        },
        transition: 'box-shadow 0.2s'
      }}
    >
      <Box sx={{ display: 'flex', alignItems: 'flex-start', justifyContent: 'space-between' }}>
        <Box sx={{ display: 'flex', alignItems: 'flex-start' }}>
          <Avatar 
            sx={{ 
              bgcolor: `${getTypeColor(type)}20`, 
              color: getTypeColor(type),
              mr: 1.5 
            }}
          >
            {getTypeIcon(type)}
          </Avatar>
          <Box>
            <Typography variant="body1" fontWeight="bold">{title}</Typography>
            <Typography variant="body2" color="text.secondary" gutterBottom>
              Standort: {location}
            </Typography>
            <Box sx={{ display: 'flex', alignItems: 'center', flexWrap: 'wrap', gap: 1, mt: 1 }}>
              {getStatusChip(status)}
              <Chip 
                size="small" 
                label={time} 
                variant="outlined" 
                sx={{ height: 20, fontSize: '0.7rem' }}
              />
              <Chip 
                size="small" 
                label={`PrioritÃ¤t: ${priority}`} 
                sx={{ 
                  height: 20, 
                  fontSize: '0.7rem', 
                  bgcolor: `${priorityColor}20`, 
                  color: priorityColor,
                  borderColor: priorityColor 
                }}
                variant="outlined"
              />
            </Box>
          </Box>
        </Box>
        <IconButton 
          size="small" 
          sx={{ color: theme.palette.primary.main }}
          onClick={() => navigate('/einsatz')}
        >
          <ArrowForwardIcon />
        </IconButton>
      </Box>
    </Paper>
  );
};

// Aktuelles-Events-Komponente
const EventItem = ({ title, time, type, icon }) => {
  const theme = useTheme();
  
  const getEventColor = (type) => {
    switch(type) {
      case 'einsatz':
        return theme.palette.error.main;
      case 'besprechung':
        return theme.palette.info.main;
      case 'training':
        return theme.palette.success.main;
      default:
        return theme.palette.primary.main;
    }
  };
  
  return (
    <ListItem 
      disableGutters 
      sx={{ 
        px: 0, 
        py: 1,
        borderLeft: `3px solid ${getEventColor(type)}`,
        pl: 1,
        mb: 1,
        bgcolor: 'rgba(0,0,0,0.02)',
        borderRadius: '0 4px 4px 0'
      }}
    >
      <ListItemAvatar>
        <Avatar sx={{ bgcolor: `${getEventColor(type)}20`, color: getEventColor(type) }}>
          {icon}
        </Avatar>
      </ListItemAvatar>
      <ListItemText
        primary={title}
        secondary={time}
        primaryTypographyProps={{ variant: 'body2', fontWeight: 'medium' }}
        secondaryTypographyProps={{ variant: 'caption' }}
      />
    </ListItem>
  );
};

// Schnellzugriff-Komponente
const QuickAccessButton = ({ icon, title, path, color }) => {
  const navigate = useNavigate();
  const theme = useTheme();
  
  return (
    <Card 
      elevation={0}
      sx={{ 
        textAlign: 'center',
        height: '100%',
        cursor: 'pointer',
        borderRadius: 2,
        border: '1px solid rgba(0,0,0,0.05)',
        '&:hover': {
          boxShadow: '0 4px 12px rgba(0,0,0,0.08)',
          transform: 'translateY(-4px)'
        },
        transition: 'transform 0.2s, box-shadow 0.2s'
      }}
      onClick={() => navigate(path)}
    >
      <CardContent sx={{ p: 2 }}>
        <Avatar 
          sx={{ 
            width: 48, 
            height: 48, 
            mx: 'auto', 
            mb: 1,
            bgcolor: theme.palette[color].main
          }}
        >
          {icon}
        </Avatar>
        <Typography variant="body2" fontWeight="medium">
          {title}
        </Typography>
      </CardContent>
    </Card>
  );
};

